import { Component } from '@angular/core';

@Component({
  selector: 'app-about-section',
  templateUrl: './about-section.component.html',
  styleUrls: ['./about-section.component.css']
})
export class AboutSectionComponent {

}
<section class="about-section">
    <p>¡Hola! Soy una programadora JR con un apasionado interés por el control de datos y la seguridad informática.
     <br>   He completado el curso CS50 de Harvard de introducción a la ciencia de la computación, lo que me ha proporcionado 
     <br>   una base sólida en los conceptos fundamentales de la programación y la informática.
    </p>
</section>
